The point $ O$ is the center of the circle circumscribed about $ \triangle ABC$, with $ \angle BOC = 120^\circ$ and $ \angle AOB = 140^\circ$, as shown. What is the degree measure of $ \angle ABC$?\\

\begin{asy}
import olympiad;
import cse5;
defaultpen(white);
size(100);
unitsize(2cm);
defaultpen(linewidth(.8pt)+fontsize(10pt));

pair B=dir(80), A=dir(220), C=dir(320), O=(0,0);

draw(unitcircle);
draw(A--B--C--O--A--C);
draw(O--B);

draw(anglemark(C,O,A,2));

label("$A$",A,SW);
label("$B$",B,NNE);
label("$C$",C,SE);
label("$O$",O,S);
label("$140^{\circ}$",O,NW,fontsize(8pt));
label("$120^{\circ}$",O,ENE,fontsize(8pt));
\end{asy}
\\
$ \textbf{(A)}\ 35 \qquad \textbf{(B)}\ 40 \qquad \textbf{(C)}\ 45 \qquad \textbf{(D)}\ 50 \qquad \textbf{(E)}\ 60$
